records.addlTxt:
Defendant Nigel R Schultz in court with attorney Bernard S. Stein.  Defendant Nigel R Schultz in custody.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Melissa R.  Defendant sentenced to serve 90 days in the House of Correction with credit for 9 days time served; STRAIGHT TIME.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 year.
Conditions:
*  Referred to the Mental Health Unit of the probation department;
*  AODA asssessment/treatment deemed appropriate;
*  Successfully complete a course in anger management;
*  Obtain a mental health evalution/treatment deemed appropriate;
*  Take all prescribed medications;
*  No use/possession of drugs/drug parapharnalia;
*  Maintain absolute sobriety to be monitored by random urine screens;
*  Participate in any treatment deemed appropriate by agent;
*  No violent contact with Melissa R.;
*  Submit a DNA sample and pay DNA surcharge or, if not paid, convert to a civil judgment;
*  Attend school regularly and make a diligent effort towards graduation;
*  Follow all rules of Melissa R.'s home;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.

Upon successful completion of probation, Court will grant expungement.  Notice of Right to Seek Postconviction Relief received and filed.
